import './App.css';
import React, { useState, useEffect } from "react"; 
import Button from 'antd/es/button';
const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
      <Button type="primary">Button</Button>
      </header>
    </div>
  );
}

export default App;
